Generalisierung und Spezialisierung sind 2 Wege, um Klassen zu vereinfachen. Beispielsweise haben wir eine Küche Klasse und eine Wohnzimmer Klasse. Beides sind Klassen, die wir Zusammenfassen könnten. Schließlich sind ja beides Räume. So könnte eine "Raum" Klasse aussehen: class Raum { boolean fenster; int tueren;
} Bisher noch nichts Neues. Wir wollen aber nicht, das ein "Raum" Objekt erstellt werden kann. Diese Klasse soll ja nur als Vereinfachung der Unterklassen [Kueche und Wohnzimmer] dienen. Deshalb machen wir die Klasse abstract. abstract class Raum {...} Jetzt haben wir eine abstrakte Klasse um Räume darzustellen. Bisher haben wir aber noch gar nichts mit unseren Unterklassen gemacht. Wir müssen dem Java Compiler sagen, das die Kueche und Wohnzimmer Klassen die "Raum" Klasse erweitern. Das geht mit dem extends Modifikator: class Kueche extends Raum {...}
class Wohnzimmer extends Raum {...} Das war die Generalisierung. Wir haben 2 Unterklassen und vereinfachen die in einer Oberklasse. Generalisierung und Spezialisierung sind das Gleiche. Nur aus einer anderen Sicht. Bei der Spezialisierung hätten wir eine Oberklasse und wollen die "spezialisieren". Es ist genau der gleiche code.

15.body:
wir können eine Klasse den abstract Modifizierer geben, damit kein Objekt von ihr erstellt werden kann. Stellt euch eine abstrakte Klasse wie eine Art "Vorlage Klasse" vor. Eine andere Klasse kann mit extends von der abstrakten Klasse abstammen (mehr dazu in "Klassenbeziehungen"). Dabei können wir einen Konstruktor mittels super() aufrufen, auf protected Attributen zugreifen und Methoden überschreiben. Hier ist ein Beispiel: public abstract class VorlageKlasse { protected int testInt; public abstract void testVoid(); public VorlageKlasse(int testInt) { this.testInt = testInt; }
} Das ist das komplizierteste, was wir machen müssen. Viele Sachen, die hier vorkommen, wurden in anderen Beiträgen erklärt. Es macht also Sinn, mindestens die folgenden: Definitionen , Generalisierung 2 und Klassenbeziehungen erstmal durchzulesen. In der ersten Zeile sehen wir abstract class VorlageKlasse { hiermit deklarieren wir eine neue abstrakte Klasse namens VorlageKlasse. In der nächsten Zeile sehen wir einen protected integer namens testInt. protected ist ähnlich wie private. Das heißt, wenn eine Klasse unserer VorlageKlasse abstammt, hat diese Klasse (und ihr Objekt) zugriff auf diesen Integer. Von außen, kann man den Integer aber nicht erreichen. Das sieht man gleich am Beispiel am besten. Dazu könnt ihr mit NetBeans / IntelliJ-Idea etwas herumspielen. So bekommt man dafür ein Gefühl. Nach dem protected integer, kommt abstract void testVoid();. Das ist eine abstrakte Methode. Besser gesagt, es ist die Signatur der abstrakten Methode. Abstrakte Methoden haben keinen Methodenrumpf wie normale Methoden . Das ist so, weil diese Methode von unserer abstammenden Klasse implementiert werden soll. Wie bereits gesagt ist unsere abstrakte Klasse nicht mehr als eine "Vorlage". Das Gleiche gilt für diese Methode. Sie ist eine Vorlage. Wie die implementiert werden soll, sieht man gleich im Beispiel. Nach unseren Attributen kommt noch unser Konstruktor. Der dürfte allen bekannt vorkommen. Hier hat sich nichts geändert. Da wir aber kein Objekt von einer abstrakten Klasse erstellen können, wird dieser mithilfe von super() in unserer abstammenden Klasse ausgeführt. Hier ist ein Beispiel, wie eine abstammende Klasse aussehen könnte; public class abstammendeKlasse extends VorlageKlasse { //normale Klasse stammt der abstrakten VorlageKlasse ab. private String testString; //normales Attribut public abstammendeKlasse(int testInt, String testString){ //normaler Konstruktor der abstammendeKlasse super(testInt); //wir rufen den Konstruktor der Oberklasse "VorlageKlasse" auf this.testString = testString; } public void testVoid() { //Diese Methode ist die implementation der abstrakten Methode in VorlageKlasse. Diese hier MUSS implementiert werden! //beispiel leere Methode } public int getTestInt() { //getter für den protected wert der VorlageKlasse return this.testInt; //wir haben in der abstammendeKlasse nirgendswo testInt deklariert. Wir können auf ihn trotzdem zugreifen, da er in der Oberklasse "VorlageKlasse" als protected deklariert wurde. }
}

