Nachdem Attribute und Methoden verstanden sind, sind Klassen an der Reihe. Der Datentyp String ist zum Beispiel eine Klasse. Klassen werden immer großgeschrieben. So wird zum Beispiel String großgeschrieben und int klein, weil int ein primitiver Datentyp ist. Klassen sind Behälter für Attribute und Methoden. Ein Objekt ist eine Ausprägung einer Klasse mit Attributwerten. Eine Klasse ist ein Weg, Attribute und Methoden zu bündeln und abzukapseln. Das bündeln kann die Programmierung vereinfachen und übersichtlicher machen. Hier eine Beispielklasse "Konto": class Konto { private int kontoNummer; private String name; public Konto(int kontoNummer, String name) { this.kontoNummer = kontoNummer; this.name = name; } public int getKontonummer() { return this.kontonummer; }
} Hier kommt auch das Prinzip von "Sichtbarkeit" ins Spiel. Die Attribute "kontoNummer" und "name" sind private. Das heißt, sie sind nur in dieser Klasse sichtbar. Nicht außerhalb unseres "Bündels" Unter den Attributwerten ist ein Beispiel Konstruktor. Ein Konstruktor ist einfach eine besondere Methode, die wir nutzen, um unser Objekt zu erstellen. Momentan ist unsere Klasse einfach ein Plan. Der Konstruktor erstellt ein Objekt, wo alle Attributwerte und Methoden drin sind. In die Objekte können wir nicht reingucken, nur in die Klassen! Danach kommt eine "getMethode" das ist eine einfache Methode, die einen privaten Wert zurückgibt. Diese ist public, da wir sie außerhalb unseres Objektes nutzen wollen. Hier ein Beispiel, wo ich ein Objekt namens konto1 erstelle und danach benutzte: Konto konto1 = new Konto(1, "Florian");
konto1.getKontonummer() //rückgabe: 1 Der Konstruktor wird mit new KLASSENNAME(); aufgerufen. Hierbei ist zu beachten, dass wir das Konto genau wie einen normalen String oder integer abspeichern. (String name = "Florian"). Hier ist auch zu sehen, das wir die public Methode "getKontonummer" über einen Punkt aufrufen. Das Objekt konto1 ist unser Bündel, wir haben nur noch Zugriff auf die public Attribute und Methoden.

